INSERT INTO `voto_legal_politico` VALUES (2,'José Abelardo Guimarães Camarinha','Abelardo Camarinha','abelardo-camarinha','38233754820',7,25,'dep.abelardocamarinha@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2011-12-12/original/87387.jpg','','Foi vereador (1976-1983, MDB) e prefeito de Marília, SP (1983-1988/ 1997-2000/ 2001-2004, PMDB). Exerceu mandatos de deputado estadual (1991-1995/ 1995-1999, PMDB) e federal (2007-2011, PSB).',NULL,8362,1),
(3,'Abelardo Luiz Lupion Mello','Abelardo Lupion','abelardo-lupion','16096843972',5,16,'dep.abelardolupion@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2011-07-28/original/86945.jpg','','Foi deputado federal (1991-1995, PRN; 1995-1999/ 1999-2003/ 2003-2007/ 2007-2011, PFL).',NULL,277,1),
(4,'Acelino Freitas','Acelino Popó','acelino-popo','88499723500',25,5,'dep.acelinopopo@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2011-02-07/original/82509.jpg','','Suplente na legislatura 2011-2015, assumiu o mandato em 2011 na vaga de Mário Negromonte, nomeado ministro das Cidades.',NULL,70275,1),
(5,'Ademir Camilo Prates Rodrigues','Ademir Camilo','ademir-camilo','48704300610',28,13,'dep.ademircamilo@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2011-02-03/original/81958.jpg','','Foi deputado federal (2003-2007, PPS; 2007-2011, PDT) e vereador (1993-1997, PSDB; 1997-2001, PPS) e vice-prefeito de Teófilo Otoni (2001-2004, PPS).',NULL,213,1),
(6,'Adrian Mussi Ramos','Adrian','adrian','92009034791',1,19,'dep.adrian@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2011-02-22/original/83097.jpg','','Foi secretário especial de Infraestrutura de Macaé na gestão de seu irmão, Riverton Mussi (2007-2010).',NULL,71496,1),
(7,'Aelton José De Freitas','Aelton Freitas','aelton-freitas','36179140634',27,13,'dep.aeltonfreitas@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2006-07-31/original/755.jpg','','Foi prefeito de Iturama (1993-1996, PSD). Exerceu os mandatos de senador (1998-2002, PMDB; 2003-2007, PL) e de deputado federal  (2007-2011, PR).',NULL,746,1),
(8,'Afonso Bandeira Florence','Afonso Florence','afonso-florence','17734150500',4,5,'dep.afonsoflorence@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2012-03-15/original/87526.jpg','','Ocupou os cargos de secretário de Desenvolvimento Urbano da Bahia (2007-2010) e de ministro do Desenvolvimento Agrário (2011-2012).',NULL,70277,1),
(9,'José Alfonso Ebert Hamm','Afonso Hamm','afonso-hamm','37040642034',16,21,'dep.afonsohamm@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2007-03-29/original/28936.jpg','','Foi vereador (1997-2001, PP) e secretário de Agricultura (1997-1998) de Bagé. Na condição de suplente, assumiu mandato na Câmara dos Deputados em 2005 e 2006 pelo PP. Foi deputado federal (2007-2011, PP).',NULL,978,1),
(10,'José Alberto Oliveira Veloso Filho','Alberto Filho','alberto-filho','00975696319',1,10,'dep.albertofilho@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2011-01-07/original/81558.jpg','','Foi vereador de Bacabal (2009-2013, PDT).',NULL,70527,1),
(11,'Alberto Pereira Mourão','Alberto Mourão','alberto-mourao','73105155872',8,25,'dep.albertomourao@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2011-02-21/original/83033.jpg','','Foi vereador (1983-1988, PMDB), vice-prefeito (1989-1992, PMDB), secretário de Educação (1989) e prefeito (1993-1996/ 2001-2004, PMDB; 2005-2008, PSDB) de Praia Grande (SP), além de deputado federal (1999-2003, PMDB). Suplente na legislatura 2011-2015, assumiu o mandato em 2011 na vaga de Silvio Torres.',NULL,72361,1),
(12,'Alceu Moreira Da Silva','Alceu Moreira','alceu-moreira','17968496004',1,21,'dep.alceumoreira@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2007-07-14/original/32369.jpg','','Foi vereador (1983-1989, PMDB), vice-prefeito (1993-1996, PMDB) e prefeito (1997-2000/ 2001-2004, PMDB) de Osório (RS), além de secretário de Habitação e Desenvolvimento Urbano do Rio Grande do Sul (2002-2006) e deputado estadual (2003-2007/ 2007-2011, PMDB).',NULL,2267,1),
(13,'Alessandro Lucciola Molon','Alessandro Molon','alessandro-molon','01416576770',4,19,'dep.alessandromolon@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2011-02-03/original/81967.jpg','','Foi deputado estadual (2003-2007/ 2007-2011).',NULL,2331,1),
