(15,'Alexandre Leite Da Silva','Alexandre Leite','alexandre-leite','22970812860',5,25,'dep.alexandreleite@camara.gov.br','http://www.excelencias.org.br/imgs/pub/2010-12-22/original/81496.jpg','','',NULL,72363,1),
